{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"markdown","source":"# Exploratory Data Analysis on Synthetic Financial Datasets For Fraud Detection","metadata":{}},{"cell_type":"markdown","source":"## Table of Contents\n\n* [1. Objectives](#1)\n* [2. Dataset Description](#2)\n* [3. Univariate Analysis](#3)\n    - [3.1 isFlaggedFraud](#3.1)\n    - [3.2 nameOrig & nameDest](#3.2)\n    - [3.3 type](#3.3)\n    - [3.4 step](#3.4)\n    - [3.5 amount, oldbalanceOrg, newbalanceOrig, oldbalanceDest, newbalanceDest](#3.5)\n* [4. Bi-/Multi-variate analysis](#4)\n    - [4.1 isFraud vs step](#4.1)\n    - [4.2 isFraud == 1 vs amount (Fraud Transaction vs Amount)](#4.2)\n    - [4.3 isFraud vs type](#4.3)\n    - [4.4 isFraud vs amount vs type](#4.4)\n* [5. Missing data/Outlier analysis & Data Cleaning](#5)\n* [6. Techniques to handle the imbalanced dataset](#6)\n    - [6.1 Oversampling](#6.1)\n    - [6.2 ROSE](#6.2)\n    - [6.3 SMOTE](#6.3)\n    - [6.4 Summary](#6.4)","metadata":{}},{"cell_type":"markdown","source":"<a id=\"1\"></a>\n## 1.&nbsp;&nbsp;Objectives\n* to perform the exploratory data analysis on dataset - Synthetic Financial Datasets For Fraud Detection\n* to demonstrate and discuss the techniques used to handle the imbalanced dataset.","metadata":{}},{"cell_type":"code","source":"#import neccessary libraries\nlibrary(tidyverse)\nlibrary(ggplot2)\nlibrary(plyr)\nlibrary(corrplot)\nlibrary(dplyr)\nlibrary(magrittr)\nlibrary(caret)\nlibrary(RColorBrewer)\n","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:27:37.296849Z","iopub.execute_input":"2022-08-23T11:27:37.299553Z","iopub.status.idle":"2022-08-23T11:27:37.329675Z"},"trusted":true},"execution_count":91,"outputs":[]},{"cell_type":"code","source":"#As DMwR was removed from the CRAN repository, we can only download formerly available version from archive\ninstall.packages(\"devtools\")\ndevtools::install_version(\"DMwR\",version = \"0.4.1\")","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"2\"></a>\n## 2.&nbsp;&nbsp;Dataset Description\n\nThis synthetic dataset contains the data of mobile money transactions which are simulated based on a sample of real transactions extracted from one month of financial logs originated from an African implemented mobile money service. \n\nIt includes total 6362620 mobile money transactions. Each transaction comes with information of total 11 attributes of which 1 datetime variable – ‘step’, 5 numeric variables – ‘amount’, ‘oldbalanceOrg’, ‘newbalanceOrig’, ‘oldbalanceDest’, ‘newbalanceDest’, 5 categorical variables – ‘type’, ‘nameOrig’, ‘nameDest’, ‘isFraud’, ‘isFlaggedFraud’.","metadata":{}},{"cell_type":"code","source":"dataset <- read.csv('../input/paysim1/PS_20174392719_1491204439457_log.csv')","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:28:09.685941Z","iopub.execute_input":"2022-08-23T11:28:09.687468Z","iopub.status.idle":"2022-08-23T11:29:14.571887Z"},"trusted":true},"execution_count":93,"outputs":[]},{"cell_type":"markdown","source":"Among all the attributes, ‘IsFraud’ is identified as the target variable for fraud detection model to classify the fraud transaction, where value of ‘0’ and ‘1’ are denoted as non-fraud and fraud respectively. Among all transactions, 99.87%(i.e. 6354407) of them are non-fraud while 0.13%(i.e. 8213) are fraud transactions. The total amount in fraud transaction is 1.05% of the total amount of all transactions. A brief\nsummary of attributes statistics that provided by R is shown as below:","metadata":{}},{"cell_type":"code","source":"head(dataset)","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:29:14.574789Z","iopub.execute_input":"2022-08-23T11:29:14.576495Z","iopub.status.idle":"2022-08-23T11:29: