pe":"code","source":"dataset$type <- as.factor(dataset$type)\ndataset$isFraud <- as.factor(dataset$isFraud)\ndataset$isFlaggedFraud <- as.factor(dataset$isFlaggedFraud)","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:29:27.388703Z","iopub.execute_input":"2022-08-23T11:29:27.390047Z","iopub.status.idle":"2022-08-23T11:29:27.785559Z"},"trusted":true},"execution_count":101,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"3\"></a>\n## 3.&nbsp;&nbsp;Univariate analysis\n\nTo gain a better and deeper understanding of each attribute, univariable analysis are performed.","metadata":{}},{"cell_type":"markdown","source":"<a id=\"3.1\"></a>\n### 3.1&nbsp;&nbsp;isFlaggedFraud\n\nAccording to the source of dataset, it describes ‘isFlaggedFraud’ flags the transaction with illegal attempts when there are massive transfers(i.e. >200,000 in a single transaction) from one account to another. It was found that there are only 16 transactions where ‘isFlaggedFraud’ is set. Diving deeper into this variable, all 16 transactions are belong to ‘TRANSFER’ type. The maximum amount of transaction where ‘isFlaggedFraud’ is not set is 92445517, which indicates the problem of ‘isFlaggedFraud’ remain not set despite the condition was met. Although the 16 transaction with ‘isFlaggedFraud’ set are always aligned with ‘isFraud’, the number of detected case by this feature is insignificant when comparing it with all the fraud case. Therefore, it is concluded that reducing this attributes from the dataset will not result in any information loss.","metadata":{}},{"cell_type":"code","source":"table(dataset$isFlaggedFraud) #6362604(0) & 16(1)","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:29:27.787979Z","iopub.execute_input":"2022-08-23T11:29:27.789415Z","iopub.status.idle":"2022-08-23T11:29:27.936335Z"},"trusted":true},"execution_count":102,"outputs":[{"output_type":"display_data","data":{"text/plain":"\n      0       1 \n6362604      16 "},"metadata":{}}]},{"cell_type":"code","source":"table(dataset$isFlaggedFraud)/length(dataset$isFlaggedFraud) #99.99975%(0) & 0.00025%(1)","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:29:27.938596Z","iopub.execute_input":"2022-08-23T11:29:27.939897Z","iopub.status.idle":"2022-08-23T11:29:28.088301Z"},"trusted":true},"execution_count":103,"outputs":[{"output_type":"display_data","data":{"text/plain":"\n           0            1 \n9.999975e-01 2.514687e-06 "},"metadata":{}}]},{"cell_type":"code","source":"dataset_transfer <-  subset(dataset,dataset$type == \"TRANSFER\") #select data from 'TRANSFER' type\nmax(dataset_transfer$amount[dataset_transfer$isFlaggedFraud == 0]) #isFlaggedFraud remain 0 despite with 'amount' > 200,000","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:29:28.090641Z","iopub.execute_input":"2022-08-23T11:29:28.091976Z","iopub.status.idle":"2022-08-23T11:29:29.481291Z"},"trusted":true},"execution_count":104,"outputs":[{"output_type":"display_data","data":{"text/html":"92445516.64","text/markdown":"92445516.64","text/latex":"92445516.64","text/plain":"[1] 92445517"},"metadata":{}}]},{"cell_type":"markdown","source":"<a id=\"3.2\"></a>\n### 3.2&nbsp;&nbsp;nameOrig & nameDest\n\nIt is found that 44 recipient accounts involves 2 fraud transactions while 0 originating account in the dataset. However, there are no obvious relationship between these 2 features and other features. It is suggested that ‘nameOrig’ and ‘nameDest’ can be reduced or ignored since it will be very time-consuming to work these unique categories.\n ","metadata":{}},{"cell_type":"code","source":"check_nameDest_fraud <- dataset %>%\n  filter(dataset$isFraud==1) %>%\n  group_by(nameDest) %>%\n  dplyr::summarise(count=n())\nnrow(check_nameDest_fraud %>%\n       filter(count >1)) #44 recipient accounts involves 2 fraud transactions","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:29:29.484843Z","iopub.execute_input":"2022-08-23T11:29:29.486651Z","iopub.status.idle":"2022-08-23T11:29:30.044521Z"},"trusted":true},"execution_count":105,"outputs":[{"output_type":"display_data","data":{"text/html":"44","text/markdown":"44","text/latex":"44","text/plain":"[1] 44"},"metadata":{}}]},{"cell_type":"code","source":"check_nameOrig_fraud <- dataset %>%\n  filter(dataset$isFraud==1) %>%\n  group_by(nameOrig) %>%\n  dplyr::summarise(count=n())\nnrow(check_nameOrig_fraud %>%\n       filter(count >1)) #0 originating accounts involves 2 fraud transactions","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:29:30.047372Z","iopub.execute_input":"2022-08-23T11:29:30.048664Z","iopub.status.idle":"2022-08-23T11:29:30.601960Z"},"trusted":true},"execution_count":106,"outputs":[{"output_type":"display_data","data":{"text/html":"0","text/markdown":"0","text/latex":"0","text/plain":"[1] 0"},"metadata":{}}]},{"cell_type":"markdown","source":"<a id=\"3.3\"></a>\n### 3.3&nbsp;&nbsp;type\n\nAccording to the figure that shown as below - Number of Transactions in Each Transaction Type, the majority of transactions came from type ‘CASH_OUT’ with over 2.2 millions entries and followed by ‘PAYMENT’,’CASH_IN’,’TRANSFER’ and ‘DEBIT’ respectively.","metadata":{}},{"cell_type":"code","source":"table(dataset$type)\nbarplot(table(dataset$type),\n        main=\"Number of Transactions in Each Transaction Type\",\n        xlab=\"Transaction Type\",\n        ylab=\"Count\",\n        ylim=c(0,2500000),\n        col=rgb(0.2,0.4,0.6,0.6))","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:29:30.604460Z","iopub.execute_input":"2022-08-23T11:29:30.605904Z","iopub.status.idle":"2022-08-23T11:29:30.980451Z"},"trusted":true},"execution_count":107,"outputs":[{"output_type":"display_data","data":{"text/plain":"\n CASH_IN CASH_OUT    DEBIT  PAYMENT TRANSFER \n 1399284  2237500    41432  2151495   532909 "},"metadata":{}},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdaWAV5d034MmeQIBAUFZxQZR