tributes, bi-/multi-variate analysis are performed.","metadata":{}},{"cell_type":"markdown","source":"<a id=\"4.1\"></a>\n### 4.1&nbsp;&nbsp;isFraud vs step\n\nThe below figures show the distribution of time of non-fraud and fraud transaction in two different time scales (i.e. time in hour over 30 days and hour of the day). It is found that non-fraud transactions usually happen during 08:00 to 00:00 and peak at evening time while fraud transaction is quite uniform throughout the day which might implies a higher chance of fraud compared to non-fraud during 00:00 to 08:00.\n","metadata":{}},{"cell_type":"code","source":"# isFraud class vs Hour of the day ('isFraud' vs 'step%%24')\ndataset$step_24hrs=dataset$step %%24\nggplot(dataset,aes(x=step_24hrs,fill=factor(isFraud))) +\n  geom_histogram(bins=24)+\n  labs( x = 'Hour of the day',y = 'No. of transactions')+\n  ggtitle('Distribution of time in a day of Non-Fraud & Fraud Transaction')+\n  scale_fill_discrete(name = \"Non Fraud & Fraud\")+\n  facet_grid(isFraud ~ ., scales = 'free_y')","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:30:43.587920Z","iopub.execute_input":"2022-08-23T11:30:43.589963Z","iopub.status.idle":"2022-08-23T11:30:53.181757Z"},"trusted":true},"execution_count":111,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3xT9ffH8XOz23TRFsoqYMsoeygoywGo4BcVZSgyBAVBQUSUJRtZCoIiIDgQ\nXCCKMkQRnDhQFOWnMkREFJHZQWeaJrm/PwKlLR3pyODyev7BI9zc+/mce2/uzbt3RVFVVQAA\nAHDp0/m7AAAAAFQMgh0AAIBGEOwAAAA0gmAHAACgEQQ7AAAAjSDYAQAAaATBDgAAQCMIdgAA\nABpxuQc75SIGc0iNKxrcef/Yzb8kFhh598QWiqJ0+/K/Ci+jQMsP1whVFOVAlqPCOyq0u8CR\neeLzwZ2vjA4xxTR+wsNJ/D4vfi+gKIviKymK8mGyzd+FXFDi+k3+4373Zjh916lCRziwor2i\nKE0f3eXNMgsRrNddvK/I66zT/09698Ea18By2PVo0+Jnwe22/zvt47L9ImB3XygPg78LCAix\n8XXNyrnXWalJJ/7+4/2VCzaser7vvA/fHNupzM2qroxvd+4xmGtdfVVsxRR6KZfhiWkd71x1\nKKVqq043talX6AiX0LzgYiWu31xP/2/Q6ONbIgxK8aP5WM24upYi/ha+tP5EPrz9xcfnvvL9\nnl8dYXW