EOwAAAAAOALBDgAAAIAj/g8pf/Vi/gnb\n4wAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"width":420,"height":420}}}]},{"cell_type":"markdown","source":"<a id=\"4.3\"></a>\n### 4.3&nbsp;&nbsp;isFraud vs type\n\nThe two figures below show Distribution of Transaction type in Non-Fraud and Fraud Transaction with percentage. It is found that all 5 types of transaction are occurred in non-fraud transactions while only 2 types (i.e. ‘CASH_OUT’ and ‘TRANSFER’)\nare occurred in fraud transactions. Moreover, both have similar percentage of the total fraud transaction.","metadata":{}},{"cell_type":"code","source":"isfraud_type <- as.data.frame.matrix(table(dataset$type,dataset$isFraud))\nisfraud_type <- tibble::rownames_to_column(isfraud_type,\"Type\")\nnames(isfraud_type)[names(isfraud_type) == \"0\"] <- \"NonFraud\"\nnames(isfraud_type)[names(isfraud_type) == \"1\"] <- \"Fraud\"\npct_nonfraud <- round(100*isfraud_type$NonFraud/sum(isfraud_type$NonFraud), digits = 2)\npct_fraud <- round(100*isfraud_type$Fraud/sum(isfraud_type$Fraud), digits = 2)\nisfraud_type$Percentage_NonFraud <- pct_nonfraud \nisfraud_type$Percentage_Fraud <- pct_fraud \nisfraud_type$Type <- as.factor(isfraud_type$Type)\nstr(isfraud_type)","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:31:04.592092Z","iopub.execute_input":"2022-08-23T11:31:04.593512Z","iopub.status.idle":"2022-08-23T11:31:06.074733Z"},"trusted":true},"execution_count":114,"outputs":[{"name":"stdout","text":"'data.frame':\t5 obs. of  5 variables:\n $ Type               : Factor w/ 5 levels \"CASH_IN\",\"CASH_OUT\",..: 1 2 3 4 5\n $ NonFraud           : int  1399284 2233384 41432 2151495 528812\n $ Fraud              : int  0 4116 0 0 4097\n $ Percentage_NonFraud: num  22.02 35.15 0.65 33.86 8.32\n $ Percentage_Fraud   : num  0 50.1 0 0 49.9\n","output_type":"stream"}]},{"cell_type":"code","source":"#Pie chart of Non Fraud Transaction with Percentage\ncols = c(\"pink\", \"thistle1\",\"mediumpurple1\",\"slategray3\", \"lightsteelblue1\