CGUJDDYIYQQQgglCQx2CCGEEEJJAoMdQgghhFCSwGCHEEIIIZQk/h8u\npTovIjS47wAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"width":420,"height":420}}}]},{"cell_type":"markdown","source":"<a id=\"5\"></a>\n## 5.&nbsp;&nbsp;Missing data/Outlier analysis & Data Cleaning\n\nSince fraud transactions only occurred in ‘TRANSFER’ & ‘CASH_OUT’, the ongoing analysis will focused on data of these 2 type of transactions. There is a need to verify whether any missing information in the data of both type of transactions. \n\nFirstly, as state in the description of dataset source, there are no information of oldbalanceDest & newbalanceDest for customers that start with M(Merchants). The dataset with both type is then checked, and it is shown that there is no recipient account start with ‘M’, therefore with the reasons as state in section 3.2, ‘nameOrig’ and ‘nameDest’ attributes can be concluded to remove from the dataset. ","metadata":{}},{"cell_type":"code","source":"#Check whether any account start with M in data of two type of transaction:'TRANSFER','CASH_OUT'\ntable(grepl(\"M\", dataset$nameDest[dataset$type=='CASH_OUT'], fixed=TRUE)) # 0 account start with M\ntable(grepl(\"M\", dataset$nameDest[dataset$type=='TRANSFER'], fixed=TRUE)) # 0 account start with M","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:32:32.120599Z","iopub.execute_input":"2022-08-23T11:32:32.122097Z","iopub.status.idle":"2022-08-23T11:32:37.928520Z"},"trusted":true},"execution_count":118,"outputs":[{"output_type":"display_data","data":{"text/plain":"\n  FALSE \n2237500 "},"metadata":{}},{"output_type":"display_data","data":{"text/plain":"\n FALSE \n532909 "},"metadata":{}}]},{"cell_type":"markdown","source":"Secondly, there is no ‘NA’ value in dataset which implies no obvious missing value, however it is found that there are 24 transactions with zero balances in originating account and recipient account both before and after with a non-zero amount is transacted. While these zero value likely denotes a missing value, and remove all 14 transactions will not affect the whole dataset as they are only small number. ","metadata":{}},{"cell_type":"code","source":"#remove attributes: nameOrig, nameDest,isFlaggedFraud\ndf <- subset(dataset, select = -c(nameOrig, nameDest,isFlaggedFraud))\n#Focusing on data with type 'TRANSFER' and 'CASH_OUT' as fraud transaction only occur in these 2 types\ndf <- subset(df,df$type == 'CASH_OUT'|df$type == 'TRANSFER')\n#Check any NA value in the new dataset\nprint(sum(is.na(df)))","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:32:37.931908Z","iopub.execute_input":"2022-08-23T11:32:37.933472Z","iopub.status.idle":"2022-08-23T11:32:39.243506Z"},"trusted":true},"execution_count":119,"outputs":[{"name":"stdout","text":"[1] 0\n","output_type":"stream"}]},{"cell_type":"markdown","source":"Moreover, there are abnormal values (0) of originating account before and after transaction with non-zero transaction amount, the percentage of such transactions is much smaller in fraud (0.3% of total fraud) compared to non-fraud transactions (47.4% of total non-fraud)\n\nAlso, there are abnormal value (0) of recipient account under the same situation, the percentage of such transactions is much larger in fraud (49.56% of total fraud) compared to non-fraud transactions (0.06% of non-fraud). \n\nHowever, it is not suitable to impute any statistic value to these missing value as from the findings above showing that the originating account balances being 0 and the recipient account balances being 0 are strong indicator of non-fraud and fraud transaction respectively. Therefore it is suggested to remain the value unchanged for the learning of model later.","metadata":{}},{"cell_type":"code","source":"#Abnormal value (0) of originating account & recipient account before and after transaction with non-zero transaction amount -> probably missing value\nnrow(df %>% filter(oldbalanceOrg == 0, newbalanceOrig == 0, amount != 0, oldbalanceDest == 0, newbalanceDest == 0)) #total 24 transactions\n##All of them belong to Non Fraud Transaction\nnrow(df %>% filter(oldbalanceOrg == 0, newbalanceOrig == 0, amount != 0, oldbalanceDest == 0, newbalanceDest == 0,isFraud==0)) #24 non fraud transactions\n##Remove the 24 transaction with all 0 in their originating account & recipient account\ndf_new <- df %>% filter(!(oldbalanceOrg == 0 & newbalanceOrig == 0 & amount != 0 & oldbalanceDest == 0 & newbalanceDest == 0 & isFraud==0))\ntable(df_new$isFraud) ","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:32:39.245715Z","iopub.execute_input":"2022-08-23T11:32:39.247015Z","iopub.status.idle":"2022-08-23T11:32:40.236993Z"},"trusted":true},"execution_count":120,"outputs":[{"output_type":"display_data","data":{"text/html":"24","text/markdown":"24","text/latex":"24","text/plain":"[1] 24"},"metadata":{}},{"output_type":"display_data","data":{"text/html":"24","text/markdown":"24","text/latex":"24","text/plain":"[1] 24"},"metadata":{}},{"output_type":"display_data","data":{"text/plain":"\n      0       1 \n2762172    8213 "},"metadata":{}}]},{"cell_type":"code","source":"#Abnormal value(0) of originating account before and after transaction with non-zero transaction amount -> probably missing value\nnrow(df_new %>% filter(oldbalanceOrg == 0, newbalanceOrig == 0, amount != 0)) #total 1308542 transactions\nnrow(df_new %>% filter(oldbalanceOrg == 0, newbalanceOrig == 0, amount != 0, isFraud==0)) #1308517 non fraud transactions\nnrow(df_new %>% filter(oldbalanceOrg == 0, newbalanceOrig == 0, amount != 0, isFraud==1)) #25 fraud transactions\nnrow(df_new %>% filter(oldbalanceOrg == 0, newbalanceOrig == 0, amount != 0, isFraud==0))/nrow(df_new %>% filter(isFraud==0)) #47.37% of non fraud in this dataset","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:32:40.239219Z","iopub.execute_input":"2022-08-23T11:32:40.240508Z","iopub.status.idle":"2022-08-23T11:32:42.421149Z"},"trusted":true},"execution_count":121,"outputs":[{"output_ty