xt/markdown":"0.495555826129307","text/latex":"0.495555826129307","text/plain":"[1] 0.4955558"},"metadata":{}}]},{"cell_type":"markdown","source":"For the outlier analysis, the result from section 4.4 shows that there is no outlier in the fraud transaction in terms of the amount as they are fall within the range. And it is found that there are no obvious outlier in the other attributes findings.","metadata":{}},{"cell_type":"code","source":"isfraud_amount_type <- subset(dataset,dataset$type == 'CASH_OUT'|dataset$type == 'TRANSFER')\n\nggplot(isfraud_amount_type,aes(x=amount,y=isFraud,colour=type)) +\n  geom_jitter(size=0.1)+\n  labs( x = 'Amount of transaction',y = 'Non Fraud & Fraud Transaction')+\n  ggtitle('Distribution of transaction amount by Non Fraud & Fraud Transaction')","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:32:43.196630Z","iopub.execute_input":"2022-08-23T11:32:43.198256Z","iopub.status.idle":"2022-08-23T11:34:07.942725Z"},"trusted":true},"execution_count":123,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2AUZd4H8O8zM9tb6qaTEFIhIfTeUaRIsYDi2cvZzt7vrHdnuTv1Xrunnif2\nrqAoigJ60nsPLb233Wy278487x8bQggtlADZ+33+2p2dfeZ5nin5ZnbmGcY5ByGEEEII6f6E\nM10BQgghhBByalCwI4QQQggJExTsCCGEEELCBAU7QgghhJAwQcGOEEIIISRMULAjhBBCCAkT\nFOwIIYQQQsIEBTtCCCGEkDBx9gY7dghJY0zqmX3hdfd9s6Wxw8zrH+rHGJvyS9Upr0aHkm9L\nMjHGCj3BU76gwy7u7OGuWXrNxIExRnVcnz+e6bqcLc7alRVmum6ns+25LnRseXxN3WFnKPzX\nSMZY/l1rTvmij0QvCoce+tprls/8kPL/7BXJGPvO5u26RYRBP6y5K//oTQiZsbn+NFf7jKCj\n5ekknekKHENKrwwNa33tcTTVlO756u1nv37npbnPfPfBfRNOuFiuuFas3CRpegwdlHJqKtqd\nq9EZj42+8J299vgBEyYNyTzsDN2oLScm7Bt4Rpwlvfr3aVffWb0wQmLHnvW0SE7P0B7hn+6z\n93/xwyla/Ma9T/979aatQXPaoLEz/vbSn/PM6s5/vVv3gzamR0bGgczHFde+omrGpF690trP\nlqART3fNut5Zsl//7+Jnq1D1Njj97Sc6q3a8ev8cFWMArvu8uG16w/oF77zzzuIadycL9zs3\nADD3eOSYc3Yo+Q+JRgA73YHONuM4q3G8DTlNFJ+KMZU+1yUrR5ql813aTXWbldWtdGazObU7\nXXtNu69tOxIOfWT5oTPsfH0EgLw7V5/yRR+JTmAAVjh