_input":"2022-08-23T11:34:07.946611Z","iopub.status.idle":"2022-08-23T11:34:10.172962Z"},"trusted":true},"execution_count":124,"outputs":[{"output_type":"display_data","data":{"text/plain":"\n      0       1 \n1933505    5764 "},"metadata":{}}]},{"cell_type":"markdown","source":"<a id=\"6.1\"></a>\n### 6.1&nbsp;&nbsp;Oversampling\n\nFor oversampling, the advantage is no information loss as it repeats the data point of fraud transaction until the number of transaction is more or less equal to the non-fraud transaction and the disadvantage is it will increase the chance of overfitting the model and which result in the situation that the model overlearn the behaviours of minority group.","metadata":{}},{"cell_type":"code","source":"#Oversampling\nset.seed(9650)\nover_train <- ovun.sample(isFraud ~ ., data = TrainSet,\n                          p = 0.5,\n                          seed = 1, method = \"over\")$data\ntable(over_train$isFraud)\n#Scatterplot Visualisation\nggplot(over_train,aes(x=step, y=amount,colour=isFraud)) +\n  geom_jitter(size=0.01)+\n  labs( x = 'Time in hr over 30 days',y = 'Amount of transaction')+\n  ggtitle('OverSampling - Distribution of transaction amount by class over time')","metadata":{"execution":{"iopub.status.busy":"2022-08-23T11:34:10.175452Z","iopub.execute_input":"2022-08-23T11:34:10.176884Z","iopub.status.idle":"2022-08-23T11:36:15.969539Z"},"trusted":true},"execution_count":125,"outputs":[{"output_type":"display_data","data":{"text/plain":"\n      0       1 \n1933505 1932845 "},"metadata":{}},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2AT9f/H8fdlp3tBWYWy9x6yQUBFBUQFQRmCggvciigOFNwKiqAofhGciDgQ\nRX4yFNyCiMoG2SCrpXQ3635/pJTuXEvTtNfn46/kcrl7f/K5u7xyK4qqqgIAAIDKzxDoAgAA\nAFA2CHYAAAA6QbADAADQCYIdAACAThDsAAAAdIJgBwAAoBMEOwAAAJ0g2AEAAOgEwU4j9w8f\nv37LdZc2jq8dZreER9do1q7X7VOf+/FAasAKyjz0v2fvu6R7m2qRYWaTJSy6Vse+Qx57belZ\nd0W84/Tfz3dWFKX/8gPep3883E5Rl