/a>\n### 6.4&nbsp;&nbsp;Summary\nAfter implementing Oversampling , ROSE, SMOTE, the number of non-fraud and fraud transaction are balanced respectively as follow, Oversampling: 1933505 non-fraud 1932845 fraud; ROSE: 970067 non-fraud 969202 fraud; SMOTE: 23056 non-fraud 17292 fraud. \n\nThe above figures show the distribution of transaction amount by class over time of new balanced dataset handled by Oversampling, ROSE , SMOTE respectively. \n\nFor this dataset, SMOTE is preferable over the other two techniques. \n\nFor SMOTE versus oversampling, oversampling just increases the size of fraud transaction and not the variety of this group, but SMOTE will increase the size of fraud transaction as well as its variety. \n\nFor SMOTE versus ROSE, according to Figure 11 – amount against time of new synthetic dataset generated by ROSE, the overlapping of classes problem occurred as the fraud transaction data point are overlapping the non-fraud transaction within amount ranging from 0 to 10 million and referring to the 3rd figure that generated by new synthetic dataset by SMOTE, although there are still overlapping of class, the fraction of overlapping is comparatively low to that of ROSE and the distribution pattern of non-fraud and fraud transaction can still be observed from this new dataset(i.e. aligned with Figure in previous session – Distribution of time by non-fraud and fraud transaction), therefore feeding the new dataset of SMOTE will be more appropriate than ROSE for the fraud detection model.","metadata":{}}]}